Ext.data.JsonP.android_transition_TransitionSet({"tagname":"class","name":"android.transition.TransitionSet","autodetected":{},"files":[{"filename":"TransitionSet.js","href":"TransitionSet.html#android-transition-TransitionSet"}],"extends":"android.transition.Transition","members":[{"name":"MATCH_ID","tagname":"property","owner":"android.transition.Transition","id":"property-MATCH_ID","meta":{}},{"name":"MATCH_INSTANCE","tagname":"property","owner":"android.transition.Transition","id":"property-MATCH_INSTANCE","meta":{}},{"name":"MATCH_ITEM_ID","tagname":"property","owner":"android.transition.Transition","id":"property-MATCH_ITEM_ID","meta":{}},{"name":"MATCH_NAME","tagname":"property","owner":"android.transition.Transition","id":"property-MATCH_NAME","meta":{}},{"name":"ORDERING_SEQUENTIAL","tagname":"property","owner":"android.transition.TransitionSet","id":"property-ORDERING_SEQUENTIAL","meta":{}},{"name":"ORDERING_TOGETHER","tagname":"property","owner":"android.transition.TransitionSet","id":"property-ORDERING_TOGETHER","meta":{}},{"name":"addListener","tagname":"method","owner":"android.transition.TransitionSet","id":"method-addListener","meta":{}},{"name":"addTarget","tagname":"method","owner":"android.transition.TransitionSet","id":"method-addTarget","meta":{}},{"name":"addTransition","tagname":"method","owner":"android.transition.TransitionSet","id":"method-addTransition","meta":{}},{"name":"canRemoveViews","tagname":"method","owner":"android.transition.Transition","id":"method-canRemoveViews","meta":{}},{"name":"captureEndValues","tagname":"method","owner":"android.transition.TransitionSet","id":"method-captureEndValues","meta":{}},{"name":"captureStartValues","tagname":"method","owner":"android.transition.TransitionSet","id":"method-captureStartValues","meta":{}},{"name":"clone","tagname":"method","owner":"android.transition.TransitionSet","id":"method-clone","meta":{}},{"name":"createAnimator","tagname":"method","owner":"android.transition.Transition","id":"method-createAnimator","meta":{}},{"name":"excludeChildren","tagname":"method","owner":"android.transition.Transition","id":"method-excludeChildren","meta":{}},{"name":"excludeTarget","tagname":"method","owner":"android.transition.TransitionSet","id":"method-excludeTarget","meta":{}},{"name":"getDuration","tagname":"method","owner":"android.transition.Transition","id":"method-getDuration","meta":{}},{"name":"getEpicenter","tagname":"method","owner":"android.transition.Transition","id":"method-getEpicenter","meta":{}},{"name":"getEpicenterCallback","tagname":"method","owner":"android.transition.Transition","id":"method-getEpicenterCallback","meta":{}},{"name":"getInterpolator","tagname":"method","owner":"android.transition.Transition","id":"method-getInterpolator","meta":{}},{"name":"getName","tagname":"method","owner":"android.transition.Transition","id":"method-getName","meta":{}},{"name":"getOrdering","tagname":"method","owner":"android.transition.TransitionSet","id":"method-getOrdering","meta":{}},{"name":"getPathMotion","tagname":"method","owner":"android.transition.Transition","id":"method-getPathMotion","meta":{}},{"name":"getPropagation","tagname":"method","owner":"android.transition.Transition","id":"method-getPropagation","meta":{}},{"name":"getStartDelay","tagname":"method","owner":"android.transition.Transition","id":"method-getStartDelay","meta":{}},{"name":"getTargetIds","tagname":"method","owner":"android.transition.Transition","id":"method-getTargetIds","meta":{}},{"name":"getTargetNames","tagname":"method","owner":"android.transition.Transition","id":"method-getTargetNames","meta":{}},{"name":"getTargetTypes","tagname":"method","owner":"android.transition.Transition","id":"method-getTargetTypes","meta":{}},{"name":"getTargets","tagname":"method","owner":"android.transition.Transition","id":"method-getTargets","meta":{}},{"name":"getTransitionAt","tagname":"method","owner":"android.transition.TransitionSet","id":"method-getTransitionAt","meta":{}},{"name":"getTransitionCount","tagname":"method","owner":"android.transition.TransitionSet","id":"method-getTransitionCount","meta":{}},{"name":"getTransitionProperties","tagname":"method","owner":"android.transition.Transition","id":"method-getTransitionProperties","meta":{}},{"name":"getTransitionValues","tagname":"method","owner":"android.transition.Transition","id":"method-getTransitionValues","meta":{}},{"name":"isTransitionRequired","tagname":"method","owner":"android.transition.Transition","id":"method-isTransitionRequired","meta":{}},{"name":"removeListener","tagname":"method","owner":"android.transition.TransitionSet","id":"method-removeListener","meta":{}},{"name":"removeTarget","tagname":"method","owner":"android.transition.TransitionSet","id":"method-removeTarget","meta":{}},{"name":"removeTransition","tagname":"method","owner":"android.transition.TransitionSet","id":"method-removeTransition","meta":{}},{"name":"setDuration","tagname":"method","owner":"android.transition.TransitionSet","id":"method-setDuration","meta":{}},{"name":"setEpicenterCallback","tagname":"method","owner":"android.transition.TransitionSet","id":"method-setEpicenterCallback","meta":{}},{"name":"setInterpolator","tagname":"method","owner":"android.transition.TransitionSet","id":"method-setInterpolator","meta":{}},{"name":"setMatchOrder","tagname":"method","owner":"android.transition.Transition","id":"method-setMatchOrder","meta":{}},{"name":"setOrdering","tagname":"method","owner":"android.transition.TransitionSet","id":"method-setOrdering","meta":{}},{"name":"setPathMotion","tagname":"method","owner":"android.transition.TransitionSet","id":"method-setPathMotion","meta":{}},{"name":"setPropagation","tagname":"method","owner":"android.transition.TransitionSet","id":"method-setPropagation","meta":{}},{"name":"setStartDelay","tagname":"method","owner":"android.transition.TransitionSet","id":"method-setStartDelay","meta":{}},{"name":"toString","tagname":"method","owner":"android.transition.Transition","id":"method-toString","meta":{}}],"alternateClassNames":[],"aliases":{},"id":"class-android.transition.TransitionSet","short_doc":"A TransitionSet is a parent of child transitions (including other\n TransitionSets). ...","classIcon":"icon-class","superclasses":["java.lang.Object","android.transition.Transition"],"subclasses":["android.transition.AutoTransition"],"mixedInto":[],"mixins":[],"parentMixins":[],"requires":[],"uses":[],"html":"<div><pre class=\"hierarchy\"><h4>Hierarchy</h4><div class='subclass first-child'>java.lang.Object<div class='subclass '><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='docClass'>android.transition.Transition</a><div class='subclass '><strong>android.transition.TransitionSet</strong></div></div></div><h4>Subclasses</h4><div class='dependency'><a href='#!/api/android.transition.AutoTransition' rel='android.transition.AutoTransition' class='docClass'>android.transition.AutoTransition</a></div><h4>Files</h4><div class='dependency'><a href='source/TransitionSet.html#android-transition-TransitionSet' target='_blank'>TransitionSet.js</a></div></pre><div class='doc-contents'><p>A TransitionSet is a parent of child transitions (including other\n TransitionSets). Using TransitionSets enables more complex\n choreography of transitions, where some sets play <a href=\"#!/api/android.transition.TransitionSet-property-ORDERING_TOGETHER\" rel=\"android.transition.TransitionSet-property-ORDERING_TOGETHER\" class=\"docClass\">ORDERING_TOGETHER</a> and\n others play <a href=\"#!/api/android.transition.TransitionSet-property-ORDERING_SEQUENTIAL\" rel=\"android.transition.TransitionSet-property-ORDERING_SEQUENTIAL\" class=\"docClass\">ORDERING_SEQUENTIAL</a>. For example, <a href=\"#!/api/android.transition.AutoTransition\" rel=\"android.transition.AutoTransition\" class=\"docClass\">android.transition.AutoTransition</a>\n uses a TransitionSet to sequentially play a Fade(Fade.OUT), followed by\n a <a href=\"#!/api/android.transition.ChangeBounds\" rel=\"android.transition.ChangeBounds\" class=\"docClass\">android.transition.ChangeBounds</a>, followed by a Fade(Fade.OUT) transition.</p>\n\n<p> <p>A TransitionSet can be described in a resource file by using the\n tag <code>transitionSet</code>, along with the standard\n attributes of android.R.styleable.TransitionSet and\n android.R.styleable.Transition. Child transitions of the\n TransitionSet object can be loaded by adding those child tags inside the\n enclosing <code>transitionSet</code> tag. For example, the following xml\n describes a TransitionSet that plays a Fade and then a ChangeBounds\n transition on the affected view targets:</p></p>\n\n<pre>     &lt;transitionSet xmlns:android=\"http://schemas.android.com/apk/res/android\"\n             android:transitionOrdering=\"sequential\"&gt;\n         &lt;fade/&gt;\n         &lt;changeBounds/&gt;\n     &lt;/transitionSet&gt;\n </pre>\n\n</div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-property'>Properties</h3><div class='subsection'><div id='property-MATCH_ID' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-property-MATCH_ID' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-property-MATCH_ID' class='name expandable'>MATCH_ID</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>With setMatchOrder(int...), chooses to match by\nandroid.view.View.getId(). ...</div><div class='long'><p>With setMatchOrder(int...), chooses to match by\nandroid.view.View.getId(). Negative IDs will not be matched.</p>\n<p>Defaults to: <code>&quot;3&quot;</code></p></div></div></div><div id='property-MATCH_INSTANCE' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-property-MATCH_INSTANCE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-property-MATCH_INSTANCE' class='name expandable'>MATCH_INSTANCE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>With setMatchOrder(int...), chooses to match by View instance. ...</div><div class='long'><p>With setMatchOrder(int...), chooses to match by View instance.</p>\n<p>Defaults to: <code>&quot;1&quot;</code></p></div></div></div><div id='property-MATCH_ITEM_ID' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-property-MATCH_ITEM_ID' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-property-MATCH_ITEM_ID' class='name expandable'>MATCH_ITEM_ID</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>With setMatchOrder(int...), chooses to match by the android.widget.Adapter\nitem id. ...</div><div class='long'><p>With setMatchOrder(int...), chooses to match by the android.widget.Adapter\nitem id. When android.widget.Adapter.hasStableIds() returns false, no match\nwill be made for items.</p>\n<p>Defaults to: <code>&quot;4&quot;</code></p></div></div></div><div id='property-MATCH_NAME' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-property-MATCH_NAME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-property-MATCH_NAME' class='name expandable'>MATCH_NAME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>With setMatchOrder(int...), chooses to match by\nandroid.view.View.getTransitionName(). ...</div><div class='long'><p>With setMatchOrder(int...), chooses to match by\nandroid.view.View.getTransitionName(). Null names will not be matched.</p>\n<p>Defaults to: <code>&quot;2&quot;</code></p></div></div></div><div id='property-ORDERING_SEQUENTIAL' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-property-ORDERING_SEQUENTIAL' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-property-ORDERING_SEQUENTIAL' class='name expandable'>ORDERING_SEQUENTIAL</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>A flag used to indicate that the child transitions of this set should\nplay in sequence; when one child transition end...</div><div class='long'><p>A flag used to indicate that the child transitions of this set should\nplay in sequence; when one child transition ends, the next child\ntransition begins. Note that a transition does not end until all\ninstances of it (which are playing on all applicable targets of the\ntransition) end.</p>\n<p>Defaults to: <code>&quot;1&quot;</code></p></div></div></div><div id='property-ORDERING_TOGETHER' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-property-ORDERING_TOGETHER' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-property-ORDERING_TOGETHER' class='name expandable'>ORDERING_TOGETHER</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>A flag used to indicate that the child transitions of this set\nshould all start at the same time. ...</div><div class='long'><p>A flag used to indicate that the child transitions of this set\nshould all start at the same time.</p>\n<p>Defaults to: <code>&quot;0&quot;</code></p></div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-addListener' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-addListener' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-addListener' class='name expandable'>addListener</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-addListener\" rel=\"android.transition.Transition-method-addListener\" class=\"docClass\">android.transition.Transition.addListener</a></p></div></div></div><div id='method-addTarget' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-addTarget' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-addTarget' class='name expandable'>addTarget</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-addTarget\" rel=\"android.transition.Transition-method-addTarget\" class=\"docClass\">android.transition.Transition.addTarget</a></p></div></div></div><div id='method-addTransition' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-addTransition' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-addTransition' class='name expandable'>addTransition</a>( <span class='pre'>transition</span> ) : Object {android.transition.TransitionSet}<span class=\"signature\"></span></div><div class='description'><div class='short'>Adds child transition to this set. ...</div><div class='long'><p>Adds child transition to this set. The order in which this child transition\n is added relative to other child transitions that are added, in addition to\n the ordering property, determines the\n order in which the transitions are started.</p>\n\n<p> <p>If this transitionSet has a duration,\n interpolator, propagation delay,\n path motion, or\n epicenter callback\n set on it, the child transition will inherit the values that are set.\n Transitions are assumed to have a maximum of one transitionSet parent.</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>transition</span> : Object {Transition}<div class='sub-desc'><p>A non-null child transition to be added to this set.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.transition.TransitionSet}</span><div class='sub-desc'><p>This transitionSet object.</p>\n</div></li></ul></div></div></div><div id='method-canRemoveViews' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-canRemoveViews' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-canRemoveViews' class='name expandable'>canRemoveViews</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n</div></div></div><div id='method-captureEndValues' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-captureEndValues' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-captureEndValues' class='name expandable'>captureEndValues</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-captureEndValues\" rel=\"android.transition.Transition-method-captureEndValues\" class=\"docClass\">android.transition.Transition.captureEndValues</a></p></div></div></div><div id='method-captureStartValues' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-captureStartValues' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-captureStartValues' class='name expandable'>captureStartValues</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-captureStartValues\" rel=\"android.transition.Transition-method-captureStartValues\" class=\"docClass\">android.transition.Transition.captureStartValues</a></p></div></div></div><div id='method-clone' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-clone' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-clone' class='name expandable'>clone</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-clone\" rel=\"android.transition.Transition-method-clone\" class=\"docClass\">android.transition.Transition.clone</a></p></div></div></div><div id='method-createAnimator' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-createAnimator' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-createAnimator' class='name expandable'>createAnimator</a>( <span class='pre'>sceneRoot, startValues, endValues</span> ) : Object {android.animation.Animator}<span class=\"signature\"></span></div><div class='description'><div class='short'>This method creates an animation that will be run for this transition\n given the information in the startValues and e...</div><div class='long'><p>This method creates an animation that will be run for this transition\n given the information in the startValues and endValues structures captured\n earlier for the start and end scenes. Subclasses of Transition should override\n this method. The method should only be called by the transition system; it is\n not intended to be called from external classes.</p>\n\n<p> <p>This method is called by the transition's parent (all the way up to the\n topmost Transition in the hierarchy) with the sceneRoot and start/end\n values that the transition may need to set up initial target values\n and construct an appropriate animation. For example, if an overall\n Transition is a <a href=\"#!/api/android.transition.TransitionSet\" rel=\"android.transition.TransitionSet\" class=\"docClass\">android.transition.TransitionSet</a> consisting of several\n child transitions in sequence, then some of the child transitions may\n want to set initial values on target views prior to the overall\n Transition commencing, to put them in an appropriate state for the\n delay between that start and the child Transition start time. For\n example, a transition that fades an item in may wish to set the starting\n alpha value to 0, to avoid it blinking in prior to the transition\n actually starting the animation. This is necessary because the scene\n change that triggers the Transition will automatically set the end-scene\n on all target views, so a Transition that wants to animate from a\n different value should set that value prior to returning from this method.</p></p>\n\n<p> <p>Additionally, a Transition can perform logic to determine whether\n the transition needs to run on the given target and start/end values.\n For example, a transition that resizes objects on the screen may wish\n to avoid running for views which are not present in either the start\n or end scenes.</p></p>\n\n<p> <p>If there is an animator created and returned from this method, the\n transition mechanism will apply any applicable duration, startDelay,\n and interpolator to that animation and start it. A return value of\n <code>null</code> indicates that no animation should run. The default\n implementation returns null.</p></p>\n\n<p> <p>The method is called for every applicable target object, which is\n stored in the <a href=\"#!/api/android.transition.TransitionValues-property-view\" rel=\"android.transition.TransitionValues-property-view\" class=\"docClass\">android.transition.TransitionValues.view</a> field.</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>sceneRoot</span> : Object {ViewGroup}<div class='sub-desc'><p>The root of the transition hierarchy.</p>\n</div></li><li><span class='pre'>startValues</span> : Object {TransitionValues}<div class='sub-desc'><p>The values for a specific target in the start scene.</p>\n</div></li><li><span class='pre'>endValues</span> : Object {TransitionValues}<div class='sub-desc'><p>The values for the target in the end scene.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.animation.Animator}</span><div class='sub-desc'><p>A Animator to be started at the appropriate time in the\n overall transition for this scene change. A null value means no animation\n should be run.</p>\n</div></li></ul></div></div></div><div id='method-excludeChildren' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-excludeChildren' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-excludeChildren' class='name expandable'>excludeChildren</a>( <span class='pre'>type, exclude, type, exclude</span> ) : Object {android.transition.Transition}<span class=\"signature\"></span></div><div class='description'><div class='short'>Whether to add the given type to the list of types whose children should\n be excluded from this transition. ...</div><div class='long'><p>Whether to add the given type to the list of types whose children should\n be excluded from this transition. The <code>exclude</code> parameter\n specifies whether the target type should be added to or removed from\n the excluded list.</p>\n\n<p> <p>Excluding targets is a general mechanism for allowing transitions to run on\n a view hierarchy while skipping target views that should not be part of\n the transition. For example, you may want to avoid animating children\n of a specific ListView or Spinner. Views can be excluded either by their\n id, or by their instance reference, or by the Class of that view\n (eg, Spinner).</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>type</span> : Object {java.lang.Class}<div class='sub-desc'><p>The type to ignore when running this transition.</p>\n</div></li><li><span class='pre'>exclude</span> : Boolean<div class='sub-desc'><p>Whether to add the target type to or remove it from the\n current list of excluded target types.\n@see <a href=\"#!/api/android.transition.Transition-method-excludeChildren\" rel=\"android.transition.Transition-method-excludeChildren\" class=\"docClass\">excludeChildren</a>(View, boolean)</p>\n</div></li><li><span class='pre'>type</span> : Object<div class='sub-desc'><p>The type to ignore when running this transition.</p>\n</div></li><li><span class='pre'>exclude</span> : Object<div class='sub-desc'><p>Whether to add the target type to or remove it from the\n current list of excluded target types.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.transition.Transition}</span><div class='sub-desc'><p>This transition object.</p>\n</div></li></ul></div></div></div><div id='method-excludeTarget' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-excludeTarget' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-excludeTarget' class='name expandable'>excludeTarget</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-excludeTarget\" rel=\"android.transition.Transition-method-excludeTarget\" class=\"docClass\">android.transition.Transition.excludeTarget</a></p></div></div></div><div id='method-getDuration' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getDuration' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getDuration' class='name expandable'>getDuration</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the duration set on this transition. ...</div><div class='long'><p>Returns the duration set on this transition. If no duration has been set,\n the returned value will be negative, indicating that resulting animators will\n retain their own durations.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>The duration set on this transition, in milliseconds, if one has been\n set, otherwise returns a negative number.</p>\n</div></li></ul></div></div></div><div id='method-getEpicenter' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getEpicenter' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getEpicenter' class='name expandable'>getEpicenter</a>( <span class='pre'></span> ) : Object {android.graphics.Rect}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the epicenter as specified by the\n android.transition.Transition.EpicenterCallback or null if no callback exi...</div><div class='long'><p>Returns the epicenter as specified by the\n <a href=\"#!/api/android.transition.Transition.EpicenterCallback\" rel=\"android.transition.Transition.EpicenterCallback\" class=\"docClass\">android.transition.Transition.EpicenterCallback</a> or null if no callback exists.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.graphics.Rect}</span><div class='sub-desc'><p>the epicenter as specified by the\n <a href=\"#!/api/android.transition.Transition.EpicenterCallback\" rel=\"android.transition.Transition.EpicenterCallback\" class=\"docClass\">android.transition.Transition.EpicenterCallback</a> or null if no callback exists.\n@see <a href=\"#!/api/android.transition.Transition-method-setEpicenterCallback\" rel=\"android.transition.Transition-method-setEpicenterCallback\" class=\"docClass\">setEpicenterCallback</a>(<a href=\"#!/api/android.transition.Transition.EpicenterCallback\" rel=\"android.transition.Transition.EpicenterCallback\" class=\"docClass\">android.transition.Transition.EpicenterCallback</a>)</p>\n</div></li></ul></div></div></div><div id='method-getEpicenterCallback' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getEpicenterCallback' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getEpicenterCallback' class='name expandable'>getEpicenterCallback</a>( <span class='pre'></span> ) : Object {android.transition.Transition.EpicenterCallback}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the callback used to find the epicenter of the Transition. ...</div><div class='long'><p>Returns the callback used to find the epicenter of the Transition.\n Transitions like <a href=\"#!/api/android.transition.Explode\" rel=\"android.transition.Explode\" class=\"docClass\">android.transition.Explode</a> use a point or Rect to orient\n the direction of travel. This is called the epicenter of the Transition and is\n typically centered on a touched View. The\n <a href=\"#!/api/android.transition.Transition.EpicenterCallback\" rel=\"android.transition.Transition.EpicenterCallback\" class=\"docClass\">android.transition.Transition.EpicenterCallback</a> allows a Transition to\n dynamically retrieve the epicenter during a Transition.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.transition.Transition.EpicenterCallback}</span><div class='sub-desc'><p>the callback used to find the epicenter of the Transition.</p>\n</div></li></ul></div></div></div><div id='method-getInterpolator' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getInterpolator' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getInterpolator' class='name expandable'>getInterpolator</a>( <span class='pre'></span> ) : Object {android.animation.TimeInterpolator}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the interpolator set on this transition. ...</div><div class='long'><p>Returns the interpolator set on this transition. If no interpolator has been set,\n the returned value will be null, indicating that resulting animators will\n retain their own interpolators.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.animation.TimeInterpolator}</span><div class='sub-desc'><p>The interpolator set on this transition, if one has been set, otherwise\n returns null.</p>\n</div></li></ul></div></div></div><div id='method-getName' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getName' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getName' class='name expandable'>getName</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the name of this Transition. ...</div><div class='long'><p>Returns the name of this Transition. This name is used internally to distinguish\n between different transitions to determine when interrupting transitions overlap.\n For example, a ChangeBounds running on the same target view as another ChangeBounds\n should determine whether the old transition is animating to different end values\n and should be canceled in favor of the new transition.</p>\n\n<p> <p>By default, a Transition's name is simply the value of Class.getName(),\n but subclasses are free to override and return something different.</p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The name of this transition.</p>\n</div></li></ul></div></div></div><div id='method-getOrdering' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-getOrdering' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-getOrdering' class='name expandable'>getOrdering</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the ordering of this TransitionSet. ...</div><div class='long'><p>Returns the ordering of this TransitionSet. By default, the value is\n <a href=\"#!/api/android.transition.TransitionSet-property-ORDERING_TOGETHER\" rel=\"android.transition.TransitionSet-property-ORDERING_TOGETHER\" class=\"docClass\">ORDERING_TOGETHER</a>.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p><a href=\"#!/api/android.transition.TransitionSet-property-ORDERING_TOGETHER\" rel=\"android.transition.TransitionSet-property-ORDERING_TOGETHER\" class=\"docClass\">ORDERING_TOGETHER</a> if child transitions will play at the same\n time, <a href=\"#!/api/android.transition.TransitionSet-property-ORDERING_SEQUENTIAL\" rel=\"android.transition.TransitionSet-property-ORDERING_SEQUENTIAL\" class=\"docClass\">ORDERING_SEQUENTIAL</a> if they will play in sequence.\n@see <a href=\"#!/api/android.transition.TransitionSet-method-setOrdering\" rel=\"android.transition.TransitionSet-method-setOrdering\" class=\"docClass\">setOrdering</a>(int)</p>\n</div></li></ul></div></div></div><div id='method-getPathMotion' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getPathMotion' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getPathMotion' class='name expandable'>getPathMotion</a>( <span class='pre'></span> ) : Object {android.transition.PathMotion}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the algorithm object used to interpolate along two dimensions. ...</div><div class='long'><p>Returns the algorithm object used to interpolate along two dimensions. This is typically\n used to determine the View motion between two points.</p>\n\n<p> <p>\n     When describing in XML, use a nested XML tag for the path motion. It can be one of\n     the built-in tags <code>arcMotion</code> or <code>patternPathMotion</code> or it can\n     be a custom PathMotion using <code>pathMotion</code> with the <code>class</code>\n     attributed with the fully-described class name. For example:</p>\n <pre>{@code\n <changeBounds>\n     <pathMotion class=\"my.app.transition.MyPathMotion\"/>\n </pathMotion></changeBounds>}\n </pre>\n <p>or</p>\n <pre>{@code\n <changeBounds>\n   <arcMotion android:minimumHorizontalAngle=\"15\"\n              android:minimumVerticalAngle=\"0\"\n              android:maximumAngle=\"90\"/>\n </arcMotion></changeBounds>}\n </pre></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.transition.PathMotion}</span><div class='sub-desc'><p>The algorithm object used to interpolate along two dimensions.\n@see <a href=\"#!/api/android.transition.ArcMotion\" rel=\"android.transition.ArcMotion\" class=\"docClass\">android.transition.ArcMotion</a>\n@see PatternPathMotion\n@see <a href=\"#!/api/android.transition.PathMotion\" rel=\"android.transition.PathMotion\" class=\"docClass\">android.transition.PathMotion</a></p>\n</div></li></ul></div></div></div><div id='method-getPropagation' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getPropagation' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getPropagation' class='name expandable'>getPropagation</a>( <span class='pre'></span> ) : Object {android.transition.TransitionPropagation}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the android.transition.TransitionPropagation used to calculate Animator start\n delays. ...</div><div class='long'><p>Returns the <a href=\"#!/api/android.transition.TransitionPropagation\" rel=\"android.transition.TransitionPropagation\" class=\"docClass\">android.transition.TransitionPropagation</a> used to calculate Animator start\n delays.\n When a Transition affects several Views like <a href=\"#!/api/android.transition.Explode\" rel=\"android.transition.Explode\" class=\"docClass\">android.transition.Explode</a> or\n <a href=\"#!/api/android.transition.Slide\" rel=\"android.transition.Slide\" class=\"docClass\">android.transition.Slide</a>, there may be a desire to have a \"wave-front\" effect\n such that the Animator start delay depends on position of the View. The\n TransitionPropagation specifies how the start delays are calculated.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.transition.TransitionPropagation}</span><div class='sub-desc'><p>the <a href=\"#!/api/android.transition.TransitionPropagation\" rel=\"android.transition.TransitionPropagation\" class=\"docClass\">android.transition.TransitionPropagation</a> used to calculate Animator start\n delays. This is null by default.</p>\n</div></li></ul></div></div></div><div id='method-getStartDelay' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getStartDelay' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getStartDelay' class='name expandable'>getStartDelay</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the startDelay set on this transition. ...</div><div class='long'><p>Returns the startDelay set on this transition. If no startDelay has been set,\n the returned value will be negative, indicating that resulting animators will\n retain their own startDelays.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>The startDelay set on this transition, in milliseconds, if one has\n been set, otherwise returns a negative number.</p>\n</div></li></ul></div></div></div><div id='method-getTargetIds' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getTargetIds' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getTargetIds' class='name expandable'>getTargetIds</a>( <span class='pre'></span> ) : Object {java.util.List}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the list of target IDs that this transition limits itself to\n tracking and animating. ...</div><div class='long'><p>Returns the list of target IDs that this transition limits itself to\n tracking and animating. If the list is null or empty for\n <a href=\"#!/api/android.transition.Transition-method-getTargetIds\" rel=\"android.transition.Transition-method-getTargetIds\" class=\"docClass\">getTargetIds</a>(), <a href=\"#!/api/android.transition.Transition-method-getTargets\" rel=\"android.transition.Transition-method-getTargets\" class=\"docClass\">getTargets</a>(), <a href=\"#!/api/android.transition.Transition-method-getTargetNames\" rel=\"android.transition.Transition-method-getTargetNames\" class=\"docClass\">getTargetNames</a>(), and\n <a href=\"#!/api/android.transition.Transition-method-getTargetTypes\" rel=\"android.transition.Transition-method-getTargetTypes\" class=\"docClass\">getTargetTypes</a>() then this transition is\n not limited to specific views, and will handle changes to any views\n in the hierarchy of a scene change.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.util.List}</span><div class='sub-desc'><p>the list of target IDs</p>\n</div></li></ul></div></div></div><div id='method-getTargetNames' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getTargetNames' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getTargetNames' class='name expandable'>getTargetNames</a>( <span class='pre'></span> ) : Object {java.util.List}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the list of target transitionNames that this transition limits itself to\n tracking and animating. ...</div><div class='long'><p>Returns the list of target transitionNames that this transition limits itself to\n tracking and animating. If the list is null or empty for\n <a href=\"#!/api/android.transition.Transition-method-getTargetIds\" rel=\"android.transition.Transition-method-getTargetIds\" class=\"docClass\">getTargetIds</a>(), <a href=\"#!/api/android.transition.Transition-method-getTargets\" rel=\"android.transition.Transition-method-getTargets\" class=\"docClass\">getTargets</a>(), <a href=\"#!/api/android.transition.Transition-method-getTargetNames\" rel=\"android.transition.Transition-method-getTargetNames\" class=\"docClass\">getTargetNames</a>(), and\n <a href=\"#!/api/android.transition.Transition-method-getTargetTypes\" rel=\"android.transition.Transition-method-getTargetTypes\" class=\"docClass\">getTargetTypes</a>() then this transition is\n not limited to specific views, and will handle changes to any views\n in the hierarchy of a scene change.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.util.List}</span><div class='sub-desc'><p>the list of target transitionNames</p>\n</div></li></ul></div></div></div><div id='method-getTargetTypes' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getTargetTypes' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getTargetTypes' class='name expandable'>getTargetTypes</a>( <span class='pre'></span> ) : Object {java.util.List}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the list of target transitionNames that this transition limits itself to\n tracking and animating. ...</div><div class='long'><p>Returns the list of target transitionNames that this transition limits itself to\n tracking and animating. If the list is null or empty for\n <a href=\"#!/api/android.transition.Transition-method-getTargetIds\" rel=\"android.transition.Transition-method-getTargetIds\" class=\"docClass\">getTargetIds</a>(), <a href=\"#!/api/android.transition.Transition-method-getTargets\" rel=\"android.transition.Transition-method-getTargets\" class=\"docClass\">getTargets</a>(), <a href=\"#!/api/android.transition.Transition-method-getTargetNames\" rel=\"android.transition.Transition-method-getTargetNames\" class=\"docClass\">getTargetNames</a>(), and\n <a href=\"#!/api/android.transition.Transition-method-getTargetTypes\" rel=\"android.transition.Transition-method-getTargetTypes\" class=\"docClass\">getTargetTypes</a>() then this transition is\n not limited to specific views, and will handle changes to any views\n in the hierarchy of a scene change.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.util.List}</span><div class='sub-desc'><p>the list of target Types</p>\n</div></li></ul></div></div></div><div id='method-getTargets' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getTargets' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getTargets' class='name expandable'>getTargets</a>( <span class='pre'></span> ) : Object {java.util.List}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the list of target views that this transition limits itself to\n tracking and animating. ...</div><div class='long'><p>Returns the list of target views that this transition limits itself to\n tracking and animating. If the list is null or empty for\n <a href=\"#!/api/android.transition.Transition-method-getTargetIds\" rel=\"android.transition.Transition-method-getTargetIds\" class=\"docClass\">getTargetIds</a>(), <a href=\"#!/api/android.transition.Transition-method-getTargets\" rel=\"android.transition.Transition-method-getTargets\" class=\"docClass\">getTargets</a>(), <a href=\"#!/api/android.transition.Transition-method-getTargetNames\" rel=\"android.transition.Transition-method-getTargetNames\" class=\"docClass\">getTargetNames</a>(), and\n <a href=\"#!/api/android.transition.Transition-method-getTargetTypes\" rel=\"android.transition.Transition-method-getTargetTypes\" class=\"docClass\">getTargetTypes</a>() then this transition is\n not limited to specific views, and will handle changes to any views\n in the hierarchy of a scene change.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.util.List}</span><div class='sub-desc'><p>the list of target views</p>\n</div></li></ul></div></div></div><div id='method-getTransitionAt' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-getTransitionAt' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-getTransitionAt' class='name expandable'>getTransitionAt</a>( <span class='pre'>index</span> )<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the child Transition at the specified position in the TransitionSet. ...</div><div class='long'><p>Returns the child Transition at the specified position in the TransitionSet.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>index</span> : Number<div class='sub-desc'><p>The position of the Transition to retrieve.\n@see <a href=\"#!/api/android.transition.TransitionSet-method-addTransition\" rel=\"android.transition.TransitionSet-method-addTransition\" class=\"docClass\">addTransition</a>(Transition)\n@see <a href=\"#!/api/android.transition.TransitionSet-method-getTransitionCount\" rel=\"android.transition.TransitionSet-method-getTransitionCount\" class=\"docClass\">getTransitionCount</a>()</p>\n</div></li></ul></div></div></div><div id='method-getTransitionCount' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-getTransitionCount' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-getTransitionCount' class='name expandable'>getTransitionCount</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the number of child transitions in the TransitionSet. ...</div><div class='long'><p>Returns the number of child transitions in the TransitionSet.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>The number of child transitions in the TransitionSet.\n@see <a href=\"#!/api/android.transition.TransitionSet-method-addTransition\" rel=\"android.transition.TransitionSet-method-addTransition\" class=\"docClass\">addTransition</a>(Transition)\n@see <a href=\"#!/api/android.transition.TransitionSet-method-getTransitionAt\" rel=\"android.transition.TransitionSet-method-getTransitionAt\" class=\"docClass\">getTransitionAt</a>(int)</p>\n</div></li></ul></div></div></div><div id='method-getTransitionProperties' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getTransitionProperties' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getTransitionProperties' class='name expandable'>getTransitionProperties</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the set of property names used stored in the android.transition.TransitionValues\n object passed into captureS...</div><div class='long'><p>Returns the set of property names used stored in the <a href=\"#!/api/android.transition.TransitionValues\" rel=\"android.transition.TransitionValues\" class=\"docClass\">android.transition.TransitionValues</a>\n object passed into <a href=\"#!/api/android.transition.Transition-method-captureStartValues\" rel=\"android.transition.Transition-method-captureStartValues\" class=\"docClass\">captureStartValues</a>(TransitionValues) that\n this transition cares about for the purposes of canceling overlapping animations.\n When any transition is started on a given scene root, all transitions\n currently running on that same scene root are checked to see whether the\n properties on which they based their animations agree with the end values of\n the same properties in the new transition. If the end values are not equal,\n then the old animation is canceled since the new transition will start a new\n animation to these new values. If the values are equal, the old animation is\n allowed to continue and no new animation is started for that transition.</p>\n\n<p> <p>A transition does not need to override this method. However, not doing so\n will mean that the cancellation logic outlined in the previous paragraph\n will be skipped for that transition, possibly leading to artifacts as\n old transitions and new transitions on the same targets run in parallel,\n animating views toward potentially different end values.</p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>An array of property names as described in the class documentation for\n TransitionValues. The default implementation returns <code>null</code>.</p>\n</div></li></ul></div></div></div><div id='method-getTransitionValues' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-getTransitionValues' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-getTransitionValues' class='name expandable'>getTransitionValues</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'>This method can be called by transitions to get the TransitionValues for\n any particular view during the transition-p...</div><div class='long'><p>This method can be called by transitions to get the TransitionValues for\n any particular view during the transition-playing process. This might be\n necessary, for example, to query the before/after state of related views\n for a given transition.</p>\n</div></div></div><div id='method-isTransitionRequired' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-isTransitionRequired' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-isTransitionRequired' class='name expandable'>isTransitionRequired</a>( <span class='pre'>startValues, endValues</span> )<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns whether or not the transition should create an Animator, based on the values\n captured during captureStartVal...</div><div class='long'><p>Returns whether or not the transition should create an Animator, based on the values\n captured during <a href=\"#!/api/android.transition.Transition-method-captureStartValues\" rel=\"android.transition.Transition-method-captureStartValues\" class=\"docClass\">captureStartValues</a>(TransitionValues) and\n <a href=\"#!/api/android.transition.Transition-method-captureEndValues\" rel=\"android.transition.Transition-method-captureEndValues\" class=\"docClass\">captureEndValues</a>(TransitionValues). The default implementation compares the\n property values returned from <a href=\"#!/api/android.transition.Transition-method-getTransitionProperties\" rel=\"android.transition.Transition-method-getTransitionProperties\" class=\"docClass\">getTransitionProperties</a>(), or all property values if\n {@code getTransitionProperties()} returns null. Subclasses may override this method to\n provide logic more specific to the transition implementation.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>startValues</span> : Object {TransitionValues}<div class='sub-desc'><p>the values from captureStartValues, This may be {@code null} if the\n                    View did not exist in the start state.</p>\n</div></li><li><span class='pre'>endValues</span> : Object {TransitionValues}<div class='sub-desc'><p>the values from captureEndValues. This may be {@code null} if the View\n                  did not exist in the end state.</p>\n</div></li></ul></div></div></div><div id='method-removeListener' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-removeListener' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-removeListener' class='name expandable'>removeListener</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-removeListener\" rel=\"android.transition.Transition-method-removeListener\" class=\"docClass\">android.transition.Transition.removeListener</a></p></div></div></div><div id='method-removeTarget' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-removeTarget' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-removeTarget' class='name expandable'>removeTarget</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-removeTarget\" rel=\"android.transition.Transition-method-removeTarget\" class=\"docClass\">android.transition.Transition.removeTarget</a></p></div></div></div><div id='method-removeTransition' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-removeTransition' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-removeTransition' class='name expandable'>removeTransition</a>( <span class='pre'>transition</span> ) : Object {android.transition.TransitionSet}<span class=\"signature\"></span></div><div class='description'><div class='short'>Removes the specified child transition from this set. ...</div><div class='long'><p>Removes the specified child transition from this set.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>transition</span> : Object {Transition}<div class='sub-desc'><p>The transition to be removed.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.transition.TransitionSet}</span><div class='sub-desc'><p>This transitionSet object.</p>\n</div></li></ul></div></div></div><div id='method-setDuration' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-setDuration' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-setDuration' class='name expandable'>setDuration</a>( <span class='pre'>duration</span> ) : Object {android.transition.TransitionSet}<span class=\"signature\"></span></div><div class='description'><div class='short'>Setting a non-negative duration on a TransitionSet causes all of the child\n transitions (current and future) to inher...</div><div class='long'><p>Setting a non-negative duration on a TransitionSet causes all of the child\n transitions (current and future) to inherit this duration.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>duration</span> : Number<div class='sub-desc'><p>The length of the animation, in milliseconds.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.transition.TransitionSet}</span><div class='sub-desc'><p>This transitionSet object.</p>\n</div></li></ul><p>Overrides: <a href=\"#!/api/android.transition.Transition-method-setDuration\" rel=\"android.transition.Transition-method-setDuration\" class=\"docClass\">android.transition.Transition.setDuration</a></p></div></div></div><div id='method-setEpicenterCallback' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-setEpicenterCallback' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-setEpicenterCallback' class='name expandable'>setEpicenterCallback</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-setEpicenterCallback\" rel=\"android.transition.Transition-method-setEpicenterCallback\" class=\"docClass\">android.transition.Transition.setEpicenterCallback</a></p></div></div></div><div id='method-setInterpolator' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-setInterpolator' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-setInterpolator' class='name expandable'>setInterpolator</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-setInterpolator\" rel=\"android.transition.Transition-method-setInterpolator\" class=\"docClass\">android.transition.Transition.setInterpolator</a></p></div></div></div><div id='method-setMatchOrder' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-setMatchOrder' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-setMatchOrder' class='name expandable'>setMatchOrder</a>( <span class='pre'>matches</span> )<span class=\"signature\"></span></div><div class='description'><div class='short'>Sets the order in which Transition matches View start and end values. ...</div><div class='long'><p>Sets the order in which Transition matches View start and end values.\n <p>\n The default behavior is to match first by android.view.View.getTransitionName(),\n then by View instance, then by android.view.View.getId() and finally\n by its item ID if it is in a direct child of ListView. The caller can\n choose to have only some or all of the values of <a href=\"#!/api/android.transition.Transition-property-MATCH_INSTANCE\" rel=\"android.transition.Transition-property-MATCH_INSTANCE\" class=\"docClass\">MATCH_INSTANCE</a>,\n <a href=\"#!/api/android.transition.Transition-property-MATCH_NAME\" rel=\"android.transition.Transition-property-MATCH_NAME\" class=\"docClass\">MATCH_NAME</a>, <a href=\"#!/api/android.transition.Transition-property-MATCH_ITEM_ID\" rel=\"android.transition.Transition-property-MATCH_ITEM_ID\" class=\"docClass\">MATCH_ITEM_ID</a>, and <a href=\"#!/api/android.transition.Transition-property-MATCH_ID\" rel=\"android.transition.Transition-property-MATCH_ID\" class=\"docClass\">MATCH_ID</a>. Only\n the match algorithms supplied will be used to determine whether Views are the\n the same in both the start and end Scene. Views that do not match will be considered\n as entering or leaving the Scene.\n </p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>matches</span> : Object {int[]}<div class='sub-desc'><p>A list of zero or more of <a href=\"#!/api/android.transition.Transition-property-MATCH_INSTANCE\" rel=\"android.transition.Transition-property-MATCH_INSTANCE\" class=\"docClass\">MATCH_INSTANCE</a>,\n                <a href=\"#!/api/android.transition.Transition-property-MATCH_NAME\" rel=\"android.transition.Transition-property-MATCH_NAME\" class=\"docClass\">MATCH_NAME</a>, <a href=\"#!/api/android.transition.Transition-property-MATCH_ITEM_ID\" rel=\"android.transition.Transition-property-MATCH_ITEM_ID\" class=\"docClass\">MATCH_ITEM_ID</a>, and <a href=\"#!/api/android.transition.Transition-property-MATCH_ID\" rel=\"android.transition.Transition-property-MATCH_ID\" class=\"docClass\">MATCH_ID</a>.\n                If none are provided, then the default match order will be set.</p>\n</div></li></ul></div></div></div><div id='method-setOrdering' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-setOrdering' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-setOrdering' class='name expandable'>setOrdering</a>( <span class='pre'>ordering</span> ) : Object {android.transition.TransitionSet}<span class=\"signature\"></span></div><div class='description'><div class='short'>Sets the play order of this set's child transitions. ...</div><div class='long'><p>Sets the play order of this set's child transitions.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>ordering</span> : Number<div class='sub-desc'><p><a href=\"#!/api/android.transition.TransitionSet-property-ORDERING_TOGETHER\" rel=\"android.transition.TransitionSet-property-ORDERING_TOGETHER\" class=\"docClass\">ORDERING_TOGETHER</a> to play this set's child\n transitions together, <a href=\"#!/api/android.transition.TransitionSet-property-ORDERING_SEQUENTIAL\" rel=\"android.transition.TransitionSet-property-ORDERING_SEQUENTIAL\" class=\"docClass\">ORDERING_SEQUENTIAL</a> to play the child\n transitions in sequence.</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {android.transition.TransitionSet}</span><div class='sub-desc'><p>This transitionSet object.</p>\n</div></li></ul></div></div></div><div id='method-setPathMotion' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-setPathMotion' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-setPathMotion' class='name expandable'>setPathMotion</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-setPathMotion\" rel=\"android.transition.Transition-method-setPathMotion\" class=\"docClass\">android.transition.Transition.setPathMotion</a></p></div></div></div><div id='method-setPropagation' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-setPropagation' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-setPropagation' class='name expandable'>setPropagation</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-setPropagation\" rel=\"android.transition.Transition-method-setPropagation\" class=\"docClass\">android.transition.Transition.setPropagation</a></p></div></div></div><div id='method-setStartDelay' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='android.transition.TransitionSet'>android.transition.TransitionSet</span><br/><a href='source/TransitionSet.html#android-transition-TransitionSet-method-setStartDelay' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.TransitionSet-method-setStartDelay' class='name expandable'>setStartDelay</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n<p>Overrides: <a href=\"#!/api/android.transition.Transition-method-setStartDelay\" rel=\"android.transition.Transition-method-setStartDelay\" class=\"docClass\">android.transition.Transition.setStartDelay</a></p></div></div></div><div id='method-toString' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/android.transition.Transition' rel='android.transition.Transition' class='defined-in docClass'>android.transition.Transition</a><br/><a href='source/Transition.html#android-transition-Transition-method-toString' target='_blank' class='view-source'>view source</a></div><a href='#!/api/android.transition.Transition-method-toString' class='name expandable'>toString</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n</div></div></div></div></div></div></div>","meta":{}});